import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';

const MapComponent = ({ threatLat,threatLong, planeLocation }) => {
  return (
    <div style={{ width: '100%', height: '300px' }}>
      <MapContainer center={[0, 0]} zoom={2} style={{ width: '100%', height: '100%' }}>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        />
        {threatLocation && (
          <Marker position={[threatLocation.latitude, threatLocation.longitude]}>
            <Popup>Threat Location</Popup>
          </Marker>
        )}
        {planeLocation && (
          <Marker position={[planeLocation.latitude, planeLocation.longitude]}>
            <Popup>Friendly Plane Location</Popup>
          </Marker>
        )}
      </MapContainer>
    </div>
  );
};

export default MapComponent;
